import {Button} from 'react-bootstrap';

const ItemCount = () => {
  return <div className="container">
            <div className="row">
                <Button>-</Button>
                <input type="number" name="cantItems" value="1" />
                <Button>+</Button>
            </div>;
        </div>
}

export default ItemCount;
